import React, { useEffect, useState } from 'react';
import axios from 'axios';
const PromoTable = () => {

    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:5077/api/ArticleApi/GetHeaders')
            .then(response => {
                setData(response.data.result);
            })
            .catch(error => {
                console.error(error);
            })
        ;
    }, []);


    return (
        <table>
            <thead>
            <tr>
                <th>ID</th>
                <th>Title</th>
                <th>Header</th>
                <th>ImageUrl</th>
                <th>Date</th>
            </tr>
            </thead>
            <tbody>
            {data.map(item => (
                <tr key={item.id}>
                    <td>{item.id}</td>
                    <td>{item.name}</td>
                    <td>{item.sumDiscount}</td>
                    <td>{item.remainder}</td>
                    <td>{item.minAmount}</td>
                </tr>
            ))}
            </tbody>
        </table>
    );
};

export default PromoTable;
